window.bookSummaryJSON = "<p><b>“Hell is empty and all the devils are here.” (William Shakespeare) </b></p> <p>Violet Parker knows better than to play with devils. They always cheat, especially when lives are at stake. Deadwood’s charming, troublemaking, and soul-sucking devils are no different, and they’re biting at her heels. </p> <p>But the clock is ticking and Violet has no choice - she must risk her life to save her treasured Aunt Zoe. With any luck, she might be able to trick the devils and beat the old terrors at their own game. If not, Deadwood could end up short one Executioner. </p> <p><b>“Executioners don’t duck, they swing.” (Violet Parker)</b></p>"; 
